                super(props);
        }

        render()
        {
          return (
                <div className="App">
                  <header className="App-header">
                    <div>   
                      <div>
                        <h2> About Us </h2>
                      </div>
                      <div>
                        <h2> Search </h2>
                      </div>
                    </div>

                    <p>
                      Landing page.
                    </p>
                  </header>
                </div>
              );
        }
}

export default landing;
